INSERT INTO `contrato_nuevopersonal` VALUES (23930697,'142102','2012-12-14','2011-07-06',6,0,'28','0','CUSCO','I',307,'Resolución Ejecutiva Regional Nº 223-2014-GR CUSCO/PR','a)	Permanecer el tiempo que dure el trabajo diario controlando la buena marcha de la Obra.\nb)	Controlar los rendimientos del personal técnico operario y obrero.\nc)	Controlar que el material a emplearse  en la obra  sea el que corresponde a las especificaciones técnicas, planos y detalles.\nd)	Controlar cualitativa y cuantitativamente  el material que llegue a la obra que éste sea el correspodniente a lo solicitado en el  requerimiento.\ne)	Coordinar con la residencia las modificaciones y replanteos de obra en el momento oportuno en redes primarios.\nf)	Presentar oportunamente  los informes semanales  de avance de obra en redes según formatos indicados.\ng)	 Realizar el tareo mensual de personal de obra en redes primarias en coordinación con el almacenero y el residente.\nh)	Mantener informado al residente constantemente de las ocurrencias más importantes en obra en redes primarios.','',864,0,1,1),(40467677,'','2013-08-05','2013-08-05',8,0,'41','0','CUSCO','I',5,'Resolución Ejecutiva Regional Nº 223-2014-GR CUSCO/PR','a)	Apoyo en la formulación y recolecciones de documentos de gestion y redacción de informes.\nb)	Recolección de información de documentos de gestión, así como la recolección de planes de desarrollo concertados.\nc)	Digitación de información  sobre planificación  estrategica.\nd)	Coordinación y comunicación de actividades en las oficinas del Gobierno Regional Cusco.\ne)	Seguimiento  de procedimientos y gestiones de la Sub Gerencia de Planeamiento.\nf)	Apoyo en diversas actividades al personal de area.\ng)	Otras funciones  que le asigne el Sub Gerente de Planeamiento.\n','',627,0,0,2),(23865597,'777','2012-01-31','2004-04-29',4,0,'18','0','CUSCO','I',5,'Resolución Ejecutiva Regional Nro. 186-2013-GR CUSCO/PR','a)	Analista de Proyectos de Inversión Pública.\nb)	Analista del Programa  de inversiones a nivel Regional.\nc)	Encargado del sistema de Geo - referenciación de la inversión Pública Regional.\nd)	Sistematización  de Proyectos de inversión Georeferenciada en indicadores Sociales.\ne)	Sistematizar  datos e información referentes al proceso  y metodologias  vinculados a la planificación  estratégica.\nf)	Participar en la formulación de los planes de desarrollo regional y los planes de los órganos  Desconcentrados  y Proyectos especiales.\ng)	Elaborar estudios básicos especialmente de corredores económicos, ciudades intermedias,  circuítos turísticos y otros que promueven  el desarrollo regional.\nh)	Realizar evaluaciones y monitoreos a proyectos de inversión pública en el ámbito regional.\ni)	Proponer  la cooperación y alianzas estratégicas  con otros gobiernos  regionales, gobiernos locales, sociedad civil y el sector privado para promover el desarrollo regional concertado y participativo.\nj)	Otras funciones que le asigne el Sub Gerente de Planeamiento.\n','',863,0,1,3),(24005284,'624','2011-12-31','2006-04-19',5,0,'26','0','CUSCO','I',0,'Resolución Ejecutiva Regional Nro. 186-2013-GR CUSCO/PR','a)	Analista de Proyectos de Inversión Pública.\nb)	Participar en la formulación, ejecución y evaluación del Plan de Trabajo Institucional de la Unidad.\nc)	Sistematizar datos e información referentes al proceso y metodologias vinculados a la planificación estrategica.\nd)	Promover la realización de estudios técnico legales para la planificación regional en coordinación con el consejo regional.\ne)	Realizar evalauaciones y monitoreos a proyectos de inversión  pública en el ambito regional.\nf)	Promover la cooperación  y analizar estratégicas con otros gobiernos regionales, gobiernos locales, sociedad civil y con el sector privado para promover el desarrollo regional concertado y participativo.\ng)	Otras funciones que le asigne el sub Gerente de Planeamiento.','',862,0,0,3),(23899167,'','2014-03-05','2014-03-05',22,0,'53','0','CUSCO','I',0,'Resoluci